import { memo } from "react";

import { Button } from "@components/common/ui/Button/Button";

import * as S from "./Projects.styled";

export const Projects: React.FC = memo(() => {
	return (
		<S.Projects>
			<S.Title>Проекты</S.Title>
			<div>
				<S.Project>
					<div>
						<S.ProjectName>Система распознавания дорожных знаков</S.ProjectName>
						<S.ProjectDescription>В рамках предмета “Распознавание образов”</S.ProjectDescription>
					</div>
					<Button>Подробнее</Button>
				</S.Project>
			</div>
		</S.Projects>
	);
});
